import InputField from '../InputField/InputField';
import './form.css';
const input_data =[
  {
    type:"text",
    placeholder:"First Name",
    name:"firstname",
    label:"First Name",
    required:"*"
  },
  {
    type:"text",
    placeholder:"Middle Name",
    name:"fname",
    label:"Middle Name",
  },
  {
    type:"text",
    placeholder:"Last Name",
    name:"lastname",
    label:"Last Name",
    required:"*"
  },
  {
    type:"date",
    placeholder:"Date Of Birth",
    name:"dob",
    label:"Date Of Birth",
    required:"*"
  },
  {
    type:"number",
    placeholder:"Contact No.",
    name:"contactnumber",
    label:"Contact No.",
    required:"*"
  },
  {
    type:"text",
    placeholder:"Address ...",
    name:"contactnumber",
    label:"Parmanent Address",
    required:"*"
  }

];
const Form =()=>{
return(
   <div className="container">
     <form action="" autocomplete="off">
   <div className="form-group ">
    <div className="form_title">
      <h3 className='text-center mt-5 mb-5'>Registration Form</h3>
    </div>
     <div className="row">

     {
      input_data.map((data)=>{
      return <InputField 
        type={data.type}
        placeholder={data.placeholder}
        name={data.name}
        label={data.label}
        required={data.required}
      />
      })
     }
   
     </div>
   </div>
  </form>
   </div>
);
}
export default Form;
